import React from "react";

const Header = ({ tittle }) => {
  return (
    <nav className="bg-[#000] flex justify-center items-center font-['Railway',sans-serif] text-center w-full ">
      <a href="/" className=" text-white  text-2xl font-semibold ">
        {tittle}
      </a>
    </nav>
  );
};

export default Header;
